import React from 'react';
import logo from './logo.svg';
import { Link } from 'react-router';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <p>
          Tryst: a calendar based dating app 
        </p>
        <li> 
          <Link to = '/'> Home </Link>
          </li>
        <a
          className="App-link"
          href="../public/index.html"
          target="_blank"
          rel="noopener noreferrer"
        >
          Click here to  date without the hassle!
        </a>
      </header>
    </div>
  );
}

export default App;
